import { useSelector } from 'react-redux';
import Navbar from './components/Navbar';

function App() {

  const { texts } = useSelector(state => state);

  return (
    <div className="App">
        <Navbar/>
        Results:
        <div>
          {texts.map( t => <div>{t.inverted}</div> )}
        </div>
    </div>
  );
}

export default App;
